import React, { useState, useTransition } from "react";
import TipDivs from "./tipdivisions.js";
import InpComps from "./inputcomps.js";
import { useEffect } from "react";
function App() {
  // const [tip, setTip] = useState(0);
  const [color, setColor] = useState('grey');
  const [bill, setBill] = useState(0);
  const [people, setPeople] = useState(5);
  const [percen, setPercent] = useState(0.05);
  const [startbill, setStartBill] = useState(0);
  useEffect(() => {
    updater();
  }, [people]);

  useEffect(() => {
    updater();
  }, [startbill]);

  useEffect(() => {
    updater();
  }, [percen]);

  // console.log("200" + "200" * 0.05)
  let tip = (startbill * percen) / people;
  let total = (startbill + tip) / people;

  function updater() {
    setBill(total);
  }

 function colorizer() {
  console.log('')
 }

  return (
    <div className="mainDiv">
      <div className="box">
        <div className="keys">
          <div className="screen">
            <div className="bill">
              <form>
                <label>Bill</label>
                <input
                  type="number"
                  onChange={(e) => {
                    setStartBill(Number(e.target.value));
                    updater();
                    console.log("here");
                  }}
                  className="inputone"
                  placeholder="$"
                ></input>
              </form>
            </div>
            <div className="tipAmount">
              <label>Select Tip % </label>
              <div className="positioner">
                <TipDivs color={{backgroundColor: color}}
                  active={() => {
                    colorizer();
                    setPercent(0.05);
                    setColor('red');
                  }}
                  amount={5}
                />
                <TipDivs color={{backgroundColor: color}}
                  active={() => {
                    setPercent(0.1);
                    setColor('red');

                  }}
                  amount={10}
                />
                <TipDivs
                  active={() => {
                    setPercent(0.2);
                  }}
                  amount={20}
                />
                <TipDivs
                  active={() => {
                    setPercent(0.25);
                  }}
                  amount={25}
                />
                <TipDivs 
                  active={() => {
                    setPercent(0.5);
                  }}
                  amount={50}
                />
                <input
                  placeholder="Custom"
                  onChange={(e) => {
                    setPercent(Number(e.target.value) / 100);
                    updater();
                    console.log("here");
                  }}
                  className="extra"
                />
              </div>
            </div>
            <div className="people">
              <form>
                <label>Number Of People</label>
                <input
                  type="number"
                  onChange={(e) => {
                    console.log("active");
                    setPeople(Number(e.target.value));
                    updater();
                  }}
                  className="inputtwo"
                  placeholder=""
                ></input>
              </form>
            </div>
          </div>
        </div>
        <div className="display">
          <div className="sc">
            <div className="screenparts">
              <div className="amount">
                <div className="screenLables">
                  <p>
                    Tip amount <span>/ Person</span>
                  </p>
                </div>

                <InpComps value={tip} />
              </div>
              <div className="total">
                <div className="screenLables">
                  <p>
                    Total <span>/ Person</span>
                  </p>
                </div>
                <InpComps value={bill} />
              </div>
            </div>
            <div className="screenbtn"> </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
